import React, {useState} from "react";
import { Link } from "react-router-dom";

const AccountForm = () => {

  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");

  const onSubmitHandler = async(event) => {
    event.preventDefault()
  }

  return (
    <form className="log form">
        <h1>Form Title</h1>
        <div className="usernamefield">
            <label>Username</label>
            <input type="text" value={username} placeholder="usersname" required onChange={(event)=> setUsername(event.target.value)} />
        </div>
        <div className="passwordfield">
            <label>Password</label>
            <input type="text" value={password} placeholder="password" required onChange={(event)=> setPassword(event.target.value)}/>
        </div>
        <Link to="">Don't have an account with us? Sign up here.</Link>
        <button className="logbutton" type="submit">Log In</button>
    </form>
  );
};

export default AccountForm;
